import React from "react";

import {
  truck,
  chemicals,
  bricks,
  flyash,
  sands,
} from "../../utils/Icon";

import { frame } from "../../utils/Constant";

const Frame = () => {
  return (
    <div className="Frame h-[320px] w-full  ">
      <div className="grid gap-4 grid-cols-4 grid-rows-2 ">
        {frame.map((k, i) => {
          return (
            <div className="ring-1 inline-flex items-center rounded-md bg-[#FFFFFF] justify-start ml-[2rem] mr-[] relative min-h-[150px] w-auto">
              <span className="text-black text-xl align-center px-[20px]" key={i}>
                {k.title}
                </span>

                <span  className="absolute bottom-0 right-0" key={i+1}>{k.image}</span>



            </div>
          );
        })}
      </div>
    </div>
  );
};

export default Frame;
